This new model will incorporate a framing effect through a relative advantage parameter.  This parameter will measure the relative advantage or disadvantage compared to the expected value based on token contributions. A high relative advantage will enhance the utility of the offer.

Additionally, rather than relying solely on the percentage difference, we'll directly model the difference between the actual split and a reference point defined by proportional contribution.


This model incorporates two learnable parameters: one representing the weight given to self-interest and the other representing the sensitivity to the relative advantage of the offer.  The relative advantage of the offer is calculated as the difference between the actual split for the participant and their proportional share, considering their initial token contribution.  This difference is then scaled by a sensitivity parameter to capture the effect of the framing on the decision.



