def simulate_model(trial_data, self_interest_weight=1, relative_advantage_sensitivity=1):
    utility_values = []
    for trial in trial_data:
        try:
            split_self = trial["split_self"]
            token_self = trial["token_self"]
            token_opp = trial["token_opp"]
            combined_earning = trial["combined_earning"]

            #Handle potential division by zero
            if (token_self + token_opp) == 0:
                proportional_share = 0
            else:
                proportional_share = (token_self / (token_self + token_opp)) * combined_earning

            utility = (self_interest_weight * split_self) + (relative_advantage_sensitivity * (split_self - proportional_share))
            utility_values.append(utility)
        except (KeyError, TypeError) as e:
            print(f"Error processing trial: {trial}. Error: {e}")
            utility_values.append(None) #or raise the exception depending on desired behavior

    return utility_values
